import React from 'react'
import './ChartBar.css'
const ChartBar = () => {
    return (
        <div className="chart-bar">
            <div className="chart-bar__inner">
            <div className="chart-bar__inner"></div>
            </div>
        </div>
    )
}

export default ChartBar
